import { AST } from "eslint";
import React from "react";
import * as S from "./styled";
import { FiPlus } from "react-icons/fi";
import profile from "../../assets/profile.jpg";

export type CardProps = {
  profile_image?: string;
  nickName: string;
  text_post: string;
  title?: string;
};

const CardPost: React.FC<CardProps> = ({
  nickName,
  profile_image,
  text_post,
  title,
}) => {
  return (
    <S.Wrapper>
      <S.ProfileImage>
        <img src={profile} alt="" />
        <h4>{nickName} </h4>
      </S.ProfileImage>
      <S.ContainerText>
        <p>{text_post}</p>
      </S.ContainerText>
    </S.Wrapper>
  );
};

export default CardPost;
